INSERT INTO `coi_category_one` VALUES ('1', '01', '01', '01', '第一类：用于工业、科学、摄影、农业、园艺和林业的化学品，未加工人造合成树脂，未加工塑料物质，肥料，灭火用合成物，淬火和焊接用制剂，保存食品用化学品，鞣料，工业粘合剂', '0', '1', '1', '0', '第一类主要包括用于工业、科学和农业的化学制品，包括用于制造属于其他类别的产品的化学制品。 \r\n本类尤其包括： \r\n——堆肥； \r\n——非食品防腐盐； \r\n——某些特定的食品工业用添加剂（查阅按字母顺序排列的商品分类表）。 \r\n本类尤其不包括： \r\n——未加工的天然树脂（第二类）； \r\n——医学科学用化学制品（第五类）； \r\n——杀真菌剂、除莠剂和消灭有害动物制剂（第五类）； \r\n——文具用或家用粘合剂（第十六类）； \r\n——食品用防腐盐（第三十类）； \r\n——褥草（腐殖土的覆盖物）（第三十一类）。');
INSERT INTO `coi_category_one` VALUES ('2', '02', '02', '02', '第二类：颜料，清漆，漆；防锈剂和木材防腐剂；着色剂；媒染剂；未加工的天然树脂；画家、装饰家、印刷商和艺术家用金属箔及金属粉', '0', '1', '1', '0', '第二类主要包括颜料、染料和防腐制品。 \r\n 本类尤其包括： \r\n——工业、手工业和艺术用颜料、清漆和漆； \r\n——服装染料； \r\n——食品和饮料用着色剂。 \r\n 本类尤其不包括： \r\n——未加工的人造树脂（第一类）； \r\n——洗衣和漂白用上蓝剂（第三类）； \r\n——美容用染料（第三类）； \r\n——颜料盒（学校用文具）（第十六类）； \r\n——绝缘颜料和绝缘漆（第十七类）。');
INSERT INTO `coi_category_one` VALUES ('3', '03', '03', '03', '第三类 洗衣用漂白剂及其他物料，清洁、擦亮、去渍及研磨用制剂，肥皂，香料，香精油，化妆品，洗发水，牙膏', '0', '1', '1', '0', '第三类主要包括清洁制剂和梳妆用制剂。 \r\n 本类尤其包括： \r\n——人用或动物用除臭剂； \r\n——室内芳香剂； \r\n——梳妆用卫生制剂。 \r\n 本类尤其不包括： \r\n——清洁烟囱用化学制品（第一类）； \r\n——生产过程中用的去渍制剂（第一类）； \r\n——非人用、非动物用除臭剂（第五类）； \r\n——磨石和砂轮（手工具）（第八类）。');
INSERT INTO `coi_category_one` VALUES ('4', '04', '04', '04', ' 第四类 工业用油和油脂；润滑剂；吸收、润湿和粘结灰尘用合成物；燃料（包括马达用燃料）和照明材料；照明用蜡烛和灯芯。 ', '0', '1', '1', '0', '第四类主要包括工业用油和油脂，燃料和照明材料。 \r\n 本类尤其不包括： \r\n——某些特殊的工业用油和油脂（查阅按字母顺序排列的商品分类表）。');
INSERT INTO `coi_category_one` VALUES ('5', '05', '05', '05', '第五类 药用和兽医用制剂；医用卫生制剂，医用或兽医用营养食品和物质，婴儿食品；人用和动物用膳食补充剂；膏药，绷敷材料，填塞牙孔用料，牙科用蜡；消毒剂；消灭有害动物制剂；杀真菌剂，除莠剂。', '0', '1', '1', '0', '第五类主要包括药品和其他医用或兽医用制剂。 \r\n 本类尤其包括： \r\n——婴儿和失禁者用尿布； \r\n——除梳妆用制剂以外的个人保健用卫生制剂； \r\n——非人用、非动物用除臭剂； \r\n——膳食补充剂，为正常饮食提供补充或为健康目的； \r\n——医用或兽医用代餐物、营养食物和饮料； \r\n——不含烟草的医用卷烟。 \r\n 本类尤其不包括： \r\n——梳妆用卫生制剂； \r\n——人用或动物用除臭剂（第三类）； \r\n——矫形用绷带（第十类）； \r\n——非医用、非兽医用的代餐物、营养食物和饮料（第二十九类、第三十类、第三十一类、第三十二类或第三十三类）。');
INSERT INTO `coi_category_one` VALUES ('6', '06', '06', '06', '第六类 普通金属及其合金；金属建筑材料；可移动金属建筑物；铁轨用金属材料；普通金属制非电气用缆线；五金具，金属小五金具；金属管；保险箱；不属别类的普通金属制品；矿石。', '0', '1', '1', '0', '第六类主要包括未加工的和半加工的普通金属，以及这些金属的简单制品。 \r\n 本类尤其不包括： \r\n——铝土（第一类）； \r\n——汞，锑，碱金属和碱土金属（第一类）； \r\n——绘画、装饰、印刷和艺术用金属箔及金属粉（第二类）。\r\n\r\n——某些按其功能或用途分类的普通金属制品（查阅按字母顺序排列的商品分类表）。');
INSERT INTO `coi_category_one` VALUES ('7', '07', '07', '07', '第七类   机器和机床；马达和引擎（陆地车辆用的除外）；机器联结器和传动机件（陆地车辆用的除外）；非手动农业器具；孵化器；自动售货机。', '0', '1', '1', '0', '第七类主要包括机器、机床、马达和引擎。 \r\n 本类尤其包括： \r\n——各类马达和引擎的部件； \r\n——电动清洁机器和装置。 \r\n 本类尤其不包括： \r\n——某些特殊的机器和机床（查阅按字母顺序排列的商品分类表）； \r\n——手动的手工具和器具（第八类）； \r\n——陆地车辆用马达和引擎（第十二类）。');
INSERT INTO `coi_category_one` VALUES ('8', '08', '08', '08', '第八类 手工具和器械（手动的）；刀、叉和勺餐具；随身武器；剃刀', '0', '1', '1', '0', '第八类主要包括各种行业的作为工具使用的手动器具。 \r\n 本类尤其包括： \r\n——贵重金属制刀、叉和勺餐具； \r\n——电动剃刀和修剪刀（手工器具） \r\n 本类尤其不包括： \r\n——某些特殊器具（查阅按字母顺序排列的商品分类表）； \r\n——马达带动的机床和器具（第七类）； \r\n——外科手术刀（第十类）； \r\n——作为火器的随身武器（第十三类）； \r\n——切纸刀（第十六类）； \r\n——击剑用兵器（第二十八类）。');
INSERT INTO `coi_category_one` VALUES ('9', '09', '09', '09', '第九类 科学、航海、测地、摄影、电影、光学、衡具、量具、信号、检验（监督）、救护（营救）和教学用具及仪器； ', '0', '1', '1', '0', '尤其包括： \r\n——实验室科研用仪器及器械； \r\n——领航用电气仪器及器械，如测量和传令仪器及器械； \r\n——量角器； \r\n——穿孔卡式办公机械； \r\n——不论录制媒体或传播途径的所有的计算机程序和软件，即包括录制在磁性媒体上的软件或从远程计算机网络上下载的软件。 \r\n尤其不包括： \r\n——下列电动仪器及器械： \r\n （1）炊事用电气用具（食品碾磨和搅拌器、榨果汁器、电动磨咖啡器等）和第七类中使用电动机的其他设备及器具； \r\n （2）抽取或分发燃料的器具（第七类）； \r\n （3）电动剃刀和理发推子（手工具）（第八类）； \r\n （4）电动牙刷和梳子（第二十一类）； \r\n （5）房间加热或液体加热、烹调、通风等电器设备（第十一类）； \r\n——钟表和其他计时器（第十四类）； \r\n——时间控制钟（第十四类）； \r\n——与外接显示屏或监视器连用的娱乐和游戏装置（第二十八类）。');
INSERT INTO `coi_category_one` VALUES ('10', '10', '10', '10', '第十类 外科、医疗、牙科和兽医用仪器及器械，假肢，假眼和假牙，矫形用品，缝合用材料 ', '0', '1', '1', '0', '第十类主要包括医疗仪器、器械及用品。 \r\n本类尤其包括： \r\n——医用特种家具； \r\n——橡胶卫生用品（查阅按字母顺序排列的商品分类表）； \r\n——矫形用绷带。');
INSERT INTO `coi_category_one` VALUES ('11', '11', '11', '11', '第十一类 照明、加温、蒸汽发生、烹饪、冷藏、干燥、通风、供水以及卫生用装置 ', '0', '1', '1', '0', '本类尤其包括： \r\n——空气调节装置； \r\n——电或非电的暖床器，暖水袋，长柄暖床炉； \r\n——非医用电热垫和电热毯： \r\n——电水壶； \r\n——电烹调用具。 \r\n本类尤其不包括： \r\n——制造蒸汽的装置（机器部件）（第七类）； \r\n——电暖衣服（第九类）。');
INSERT INTO `coi_category_one` VALUES ('12', '12', '12', '12', '第十二类 运载工具，陆、空、海用运载器', '0', '1', '1', '0', '[注释]\r\n本类尤其包括： \r\n——陆地车辆用马达和引擎； \r\n——陆地车辆用联结器和传动机件； \r\n——气垫船。 \r\n本类尤其不包括： \r\n——某些非运输用途的特种车辆（查阅按字母顺序排列的商品分类表）； \r\n——车辆的某些部件（查阅按字母顺序排列的商品分类表）； \r\n——铁路用金属材料（第六类）； \r\n——非陆地车辆用马达、引擎、联结器和传动机件（第七类）； \r\n——所有马达和引擎的部件（第七类）。');
INSERT INTO `coi_category_one` VALUES ('13', '13', '13', '13', '第十三类 火器；军火及弹药；爆炸物；烟火。', '0', '1', '1', '0', '[注释]\r\n第十三类主要包括火器和花炮产品。 \r\n本类尤其不包括 \r\n——火柴（第三十四类）。');
INSERT INTO `coi_category_one` VALUES ('14', '14', '14', '14', '第十四类 贵重金属及其合金，不属别类的贵重金属制品或镀有贵重金属的物品；珠宝首饰，宝石；钟表和计时仪器', '0', '1', '1', '0', '[注释]\r\n第十四类主要包括贵重金属，贵重金属制品或镀贵重金属制品，并通常包括珠宝首饰和钟表。 \r\n本类尤其包括：\r\n ——某些按其功能或用途分类的贵重金属制品（查阅按字母顺\r\n序排列的商品分类表），如：绘画、装饰、印刷和艺术用金属箔及金属粉（第二类），牙科用金汞合金（第五类），刀、叉和勺餐具（第八类），电触点（第九类），金笔尖（第十六类），茶壶（第二十一类），金银线制刺绣品（第二十六类），雪茄烟盒（第三十四类）\r\n——首饰（即仿真首饰、贵重金属制首饰和宝石）； \r\n——衬衫袖口的链扣，领带饰针。 \r\n本类尤其不包括： \r\n——按功能或用途进行分类的贵重金属制品，如：画家、装饰家、印刷商和艺术家用金属箔及金属粉（第二类），牙科用金汞合金（第五类），刀、叉和勺餐具（第八类），电触点（第九类），金笔尖（第十六类），茶壶（第二十一类），金银线制刺绣品（第二十六类），雪茄烟盒（第三十四类）； \r\n——非贵重金属制艺术品（按其原料分类）。');
INSERT INTO `coi_category_one` VALUES ('15', '15', '15', '15', '第十五类 乐器', '0', '1', '1', '0', '[注释]\r\n本类尤其包括： \r\n——机械钢琴及其附件； \r\n——八音盒； \r\n——电动和电子乐器。 \r\n本类尤其不包括： \r\n——录音、播音、扩音和放音装置（第九类）。');
INSERT INTO `coi_category_one` VALUES ('16', '16', '16', '16', '第十六类 纸和纸板，不属别类的纸和纸板制品；印刷品；装订用品；照片；文具；文具或家庭用粘合剂；美术用品；画笔；打字机和办公用品（家具除外）；教育或教学用品（仪器除外）；包装用塑料物品（不属别类的）；印刷铅字；印版。', '0', '1', '1', '0', '[注释]\r\n第十六类主要包括纸和纸板及其制品和办公用品。 \r\n本类尤其包括： \r\n——切纸刀； \r\n——油印机； \r\n——包装用塑料纸、塑料提兜和塑料袋。 \r\n——纸制桌布和餐巾。\r\n本类尤其不包括： \r\n ——某些按其功能或用途分类的纸制品和纸板制品（查阅按字母顺序排列的商品分类表）； \r\n——颜料（第二类）； \r\n——艺术家用手工具（如修平刀、雕塑凿刀）（第八类）。\r\n——纸制床单和枕套（第二十四类）');
INSERT INTO `coi_category_one` VALUES ('17', '17', '17', '17', '第十七类 橡胶、古塔胶、树胶、石棉、云母，以及不属别类的这些原材料的制品；生产用成型塑料制品；包装、填充和绝缘用材料；非金属软管。', '0', '1', '1', '0', '[注释]\r\n第十七类主要包括电绝缘、隔热或隔音材料，以及生产用塑料片、板或杆，和属于本类的这些原材料的制品。 \r\n本类尤其包括： \r\n——修复轮胎用橡胶材料； \r\n——橡胶或塑料制衬垫及填充料； \r\n——抗污染的浮动屏障。\r\n本类尤其不包括：\r\n——某些按其功能或用途分类的本类原材料制品（查阅按字母顺序排\r\n列的商品分类表）');
INSERT INTO `coi_category_one` VALUES ('18', '18', '18', '18', '第十八类 皮革和人造皮革，不属别类的皮革和人造皮革制品；毛皮；箱子和旅行袋；雨伞和阳伞；手杖；鞭和马具', '0', '1', '1', '0', '[注释]\r\n第十八类主要包括皮革、人造皮革及其制品，旅行用品和马具。\r\n本类尤其包括：\r\n——行李标签 \r\n本类尤其不包括： \r\n——服装、鞋、帽（查阅按字母顺序排列的商品分类表）。\r\n——某些按其功能或用途分类的皮革、人造皮革、毛皮制品（查阅按字母顺序排列的商品分类表）');
INSERT INTO `coi_category_one` VALUES ('19', '19', '19', '19', '第十九类 非金属的建筑材料，建筑用非金属刚性管，沥青，柏油，可移动非金属建筑物，非金属碑', '0', '1', '1', '0', '[注释]\r\n第十九类主要包括非金属建筑材料。 \r\n本类尤其包括： \r\n——半成品木材（如横梁、板、护板）； \r\n——胶合板； \r\n——建筑用玻璃（如平板、玻璃瓦片）； \r\n——路标用玻璃颗粒； \r\n——混凝土制信箱。 \r\n本类尤其不包括： \r\n——水泥贮藏或防水用制剂（第一类）； \r\n——防火制剂（第一类）。');
INSERT INTO `coi_category_one` VALUES ('20', '20', '20', '20', '第二十类 家具，镜子，相框，不属别类的木、软木、苇、藤、柳条、角、骨、象牙、鲸骨、贝壳、琥珀、珍珠母、海泡石制品，这些材料的代用品或塑料制品', '0', '1', '1', '0', '[注释]\r\n第二十类主要包括家具及其部件，由木、软木、苇、藤、柳条、角、骨、象牙、鲸骨、贝壳、琥珀、珍珠母、海泡石以及这些材料的代用品或塑料制成的某些制品。 \r\n本类尤其包括： \r\n——金属家具和野营用家具； \r\n——床上用品（如床垫、弹簧垫、枕头）； \r\n——镜子，家具用和梳妆用镜； \r\n——非金属牌照； \r\n——非金属、非混凝土制信箱。 \r\n本类尤其不包括： \r\n——某些按其功能或用途分类的镜子（查阅按字母顺序排列的商品分类表）； \r\n——实验室用特种家具（第九类）； \r\n——医用特种家具（第十类）； \r\n——床单和枕套（第二十四类）； \r\n——鸭绒被（第二十四类）。\r\n——某些按其功能或用途分类的由木、软木、苇、藤、柳条、角、骨、象牙、鲸骨、贝\r\n壳、琥珀、珍珠母、海泡石以及这些材料的代用品或塑料制成的产品（查阅按字母顺序排列的商品分类表）。');
INSERT INTO `coi_category_one` VALUES ('21', '21', '21', '21', '第二十一类 家庭或厨房用具及容器（非贵重金属所制，也非镀有贵重金属的），梳子及海棉刷子（画笔除外），制刷材料，清扫用具，钢丝绒，未加工或半加工玻璃（建筑用玻璃除外），不属别类的玻璃器皿、瓷器及陶器', '0', '1', '1', '0', '[注释]\r\n第二十一类主要包括家庭和厨房用小型手动器具以及盥洗室用具、玻璃器皿和瓷器。 \r\n本类尤其包括： \r\n——家庭和厨房用器具及容器，如：厨房用具，桶，用铁、铝、塑料或其他材料制成的盆，以及小型手动的切碎机、研磨机、压榨机； \r\n——电梳； \r\n——电牙刷； \r\n——碗碟架和饮料瓶架（餐具）。 \r\n本类尤其不包括： \r\n——某些按其功能或用途分类的玻璃制品、瓷器和陶器（查阅按字母顺序排列的商品分类表）； \r\n——清洁制剂、肥皂等（第三类）； \r\n——小型电动的切碎机、研磨机、压榨机（第七类）； \r\n——剃刀及剃毛装置、修剪刀（手工器具）、修指甲和修脚的金属器具（第八类）； \r\n——电烹饪器具（第十一类）； \r\n——梳妆镜（第二十类）。');
INSERT INTO `coi_category_one` VALUES ('22', '22', '22', '22', '第二十二类 缆，绳，网，遮蓬，帐篷，防水遮布，帆，袋和包（不属别类的），衬垫及填充料（橡胶或塑料除外），纺织用纤维原料。', '0', '1', '1', '0', '[注释]\r\n第二十二类主要包括帆布和制帆用其他材料，绳缆，衬垫和填充材料，纺织用纤维原料。 \r\n本类尤其包括： \r\n——用天然或人工纺织纤维、纸或塑料制成的缆和绳。 \r\n——运输或贮存大批货物和原材料用袋和包（查阅按字母顺序排列的商品分类表）\r\n本类尤其不包括： \r\n——某些网和包（查阅按字母顺序排列的商品分类表）； \r\n——乐器弦（第十五类）。\r\n——纸或纸板制衬垫及填充料（第十六类），橡胶或塑料制衬垫及填充料（第十七类）');
INSERT INTO `coi_category_one` VALUES ('23', '23', '23', '23', '第二十三类 纺织品用纱、线', '0', '1', '1', '0', '无');
INSERT INTO `coi_category_one` VALUES ('24', '24', '24', '24', '第二十四类 布料和不属别类的纺织品；床单；桌布。', '0', '1', '1', '0', '[注释]\r\n第二十四类主要包括纺织品（布匹）和家用纺织品制罩布。 \r\n本类尤其包括： \r\n——家用亚麻布；\r\n——纸制床单和枕套。 \r\n本类尤其不包括： \r\n——某些特殊织物（查阅按字母顺序排列的商品分类表）； \r\n——医用电热毯（第十类）和非医用电热毯（第十一类）； \r\n——纸制桌布和餐巾（第十六类）； \r\n——马用罩布（第十八类）。');
INSERT INTO `coi_category_one` VALUES ('25', '25', '25', '25', '第二十五类 服装，鞋，帽', '0', '1', '1', '0', '[注释]\r\n本类尤其不包括： \r\n——某些特殊用途的服装和鞋（查阅按字母顺序排列的商品分类表）。');
INSERT INTO `coi_category_one` VALUES ('26', '26', '26', '26', '第二十六类 花边和刺绣；饰带和编带；纽扣，领钩扣，饰针及缝针；假花。', '0', '1', '1', '0', '[注释]\r\n第二十六类主要包括缝纫用品。 \r\n本类尤其包括： \r\n——拉链。 \r\n本类尤其不包括： \r\n——某些特种小钩（查阅按字母顺序排列的商品分类表）； \r\n——某些特种针（查阅按字母顺序排列的商品分类表）； \r\n——纺织用纱和线（第二十三类）。');
INSERT INTO `coi_category_one` VALUES ('27', '27', '27', '27', '第二十七类 地毯，地席，席类，油毡及其他铺地板材料；非纺织品制墙帷。', '0', '1', '1', '0', '[注释]\r\n第二十七类主要包括铺在已建成的地板和墙壁上的制品。 \r\n本类尤其不包括： \r\n——木地板（第十九类）。');
INSERT INTO `coi_category_one` VALUES ('28', '28', '28', '28', '第二十八类 游戏器具和玩具，不属别类的体育和运动用品，圣诞树用装饰品', '0', '1', '1', '0', '[注释]\r\n本类尤其包括： \r\n——与外接显示屏或监视器连用的娱乐和游戏装置； \r\n——钓鱼用具； \r\n——各种运动和游戏设备。 \r\n本类尤其不包括： \r\n——圣诞树用的蜡烛（第四类）； \r\n——潜水装备（第九类）； \r\n——圣诞树用的电灯（花彩式的）（第十一类）； \r\n——渔网（第二十二类）； \r\n——体育和运动用服装（第二十五类）；\r\n——某些体育和运动用品（查阅按字母顺序排列的商品分类表）；\r\n——圣诞树装饰用糖果和巧克力（第三十类）。');
INSERT INTO `coi_category_one` VALUES ('29', '29', '29', '29', '第二十九类 肉，鱼，家禽及野味，肉汁，腌渍、冷冻、干制及煮熟的水果和蔬菜，果冻，果酱，蜜饯，蛋，奶和奶制品，食用油和油脂', '0', '1', '1', '0', '第二十九类主要包括动物类食品，以及日用或贮藏用的蔬菜及其他可食用的园艺产品。 \r\n本类尤其包括： \r\n——奶饮料（以奶为主）。 \r\n本类尤其不包括： \r\n——某些植物类食品（查阅按字母顺序排列的商品分类表）； \r\n——婴儿食品（第五类）； \r\n——医用营养食物和物质（第五类）； \r\n——膳食补充剂（第五类）； \r\n——色拉调味品（第三十类）。 \r\n——待孵蛋（第三十一类）； \r\n——动物饲料（第三十一类）； \r\n——活的动物（第三十一类）。');
INSERT INTO `coi_category_one` VALUES ('30', '30', '30', '30', '第三十类 咖啡，茶，可可和咖啡代用品；米；食用淀粉和西米；面粉和谷类制品；面包、糕点和甜食；冰制食品；糖，蜂蜜，糖浆；鲜酵母，发酵粉；食盐；芥末；醋，沙司（调味品）；辛香料；饮用冰', '0', '1', '1', '0', '第三十类主要包括日用或贮藏用的植物类食品，以及调味佐料。 \r\n本类尤其包括： \r\n——以咖啡，可可，巧克力或茶为主的饮料； \r\n——人类食用谷物（如燕麦片或其他谷物）。 \r\n本类尤其不包括： \r\n——某些植物类食品（查阅按字母顺序排列的商品分类表）； \r\n——非食用防腐盐（第一类）； \r\n——药茶和医用营养食物和物质（第五类）； \r\n——婴儿食品（第五类）； \r\n——膳食补充剂（第五类）； \r\n——未加工的谷物（第三十一类）； \r\n——动物饲料（第三十一类）。');
INSERT INTO `coi_category_one` VALUES ('31', '31', '31', '31', '第三十一类 谷物和不属别类的农业、园艺、林业产品；活动物；新鲜水果和蔬菜；种子；草木和花卉；动物饲料；麦芽', '0', '1', '1', '0', '[注释]\r\n第三十一类主要包括日用的未经制作的田地产物，活动物及植物，以及动物饲料。 \r\n本类尤其包括： \r\n——未加工的木材； \r\n——未加工的谷物； \r\n——待孵蛋； \r\n——软体动物和贝壳类动物（活的）。 \r\n本类尤其不包括： \r\n——微生物培养物和医用水蛭（第五类）； \r\n——动物用膳食补充剂（第五类）； \r\n——半成品木材（第十九类）； \r\n——人造鱼饵（第二十八类）； \r\n——米（第三十类）； \r\n——烟草（第三十四类）。');
INSERT INTO `coi_category_one` VALUES ('32', '32', '32', '32', '第三十二类 啤酒，矿泉水和汽水以及其他不含酒精的饮料；水果饮料及果汁；糖浆及其他制饮料用的制剂', '0', '1', '1', '0', '[注释]\r\n第三十二类主要包括不含酒精的饮料及啤酒。 \r\n本类尤其包括： \r\n——无酒精饮料。 \r\n本类尤其不包括： \r\n——医用饮料（第五类）； \r\n——奶饮料（以奶为主）（第二十九类）； \r\n——以咖啡、可可、巧克力或茶为主的饮料（第三十类）。');
INSERT INTO `coi_category_one` VALUES ('33', '33', '33', '33', '第三十三类 含酒精的饮料（啤酒除外）', '0', '1', '1', '0', '[注释]\r\n本类尤其不包括： \r\n——医用饮料（第五类）； \r\n——无酒精饮料（第三十二类）。');
INSERT INTO `coi_category_one` VALUES ('34', '34', '34', '34', '第三十四类 烟草；烟具；火柴。', '0', '1', '1', '0', '[注释]\r\n本类尤其包括： \r\n——烟草代用品（非医用的）。 \r\n 本类尤其不包括： \r\n——不含烟草的医用卷烟（第五类）。');
INSERT INTO `coi_category_one` VALUES ('35', '35', '35', '35', '第三十五类 广告；商业经营；商业管理；办公事务', '0', '1', '1', '0', '[注释]\r\n第三十五类主要包括由个人或组织提供的服务，其主要目的在于： \r\n（1）对商业企业的经营或管理进行帮助； \r\n（2）对工商企业的业务活动或者商业职能的管理进行帮助； \r\n以及由广告部门为各种商品或服务提供的服务，旨在通过各种传播方式向公众进行广告宣传。 \r\n本类尤其包括： \r\n——为他人将各种商品（运输除外）归类，以便顾客看到和购买；这种服务可由零售、批发商店通过邮购目录或电子媒介提供，例如通过网站或电视购物节目； \r\n——有关注册、抄录、写作、编篡、或者书面通讯及记录系统化，以及编篡数学或者统计资料的服务； \r\n——广告单位的服务，以及直接或邮寄散发说明书或者样品的服务；本类可涉及有关其他服务的广告，如银行借贷或无线电广告服务。 \r\n本类尤其不包括： \r\n——与工商企业的经营或者管理无直接关系的估价和编写工程师报告的服务（查阅按字母顺序排列的服务分类表）。');
INSERT INTO `coi_category_one` VALUES ('36', '36', '36', '36', '第三十六类 保险；金融事务；货币事务；不动产事务', '0', '1', '1', '0', '[注释]\r\n第三十六类主要包括金融业务和货币业务提供的服务以及与各种保险契约有关的服务。 \r\n本类尤其包括： \r\n——与金融业务和货币业务有关的服务，即： \r\n（1）银行及其有关的机构的服务，如外汇经纪人或清算机构； \r\n（2）不属于银行的信贷部门的服务，如信贷合作社团、私人金融公司、放款人等的服务； \r\n（3）控股公司的“投资信托”服务； \r\n（4）股票及财产经纪人的服务； \r\n（5）与承受信用代理人担保的货币业务有关的服务； \r\n（6）与发行旅行支票和信用证有关的服务； \r\n——融资租赁服务 \r\n——不动产管理人对建筑物的服务，如租赁、估价或筹措资金的服务； \r\n——与保险有关的服务，如保险代理人或经纪人提供的服务，为被保险人和承保人提供的服务。');
INSERT INTO `coi_category_one` VALUES ('37', '37', '37', '37', '第三十七类 房屋建筑；修理；安装服务', '0', '1', '1', '0', '[注释]\r\n第三十七类主要包括建造永久性建筑的承包商或分包商所提供的服务，以及由个人或组织为修复建筑物或保持原样而不改变其物理或化学特征的服务。 \r\n本类尤其包括： \r\n——建筑房屋、道路、桥梁、堤坝或通讯线路的服务，以及建筑行业其他专项服务，如油漆粉刷、管道铺设、安装暖气或盖屋顶； \r\n——为建筑服务的辅助性服务，如建筑计划的检查； \r\n——造船服务； \r\n——租赁建筑工具或材料的服务； \r\n——修理服务，即修复已磨损、损坏或部分破坏的任何东西（修复房屋或将其他残缺之物修复原样）； \r\n——各种修理服务，如修理电器、家具、器械和工具等； \r\n——维修服务，旨在使物品保持原样而不改变其任何属性（有关本类与第四十类的区别，请看第四十类的注释）。 \r\n本类尤其不包括： \r\n——诸如服装或车辆之类商品的储存服务（第三十九类）； \r\n——与布料或服装印染有关的服务（第四十类）。');
INSERT INTO `coi_category_one` VALUES ('38', '38', '38', '38', '第三十八类 电信', '0', '1', '1', '0', '[注释]\r\n第三十八类主要包括至少能使二人之间通过感觉方式进行通讯的服务。这类服务包括： \r\n（1）能使一人与另一人进行交谈； \r\n（2）将一人的消息传递给另一人； \r\n（3）使一人与另一人进行口头或视觉的联系（无线电和电视）。 \r\n本类尤其包括： \r\n——主要进行播放无线电或电视节目的服务。 \r\n本类尤其不包括： \r\n——无线电广告服务（第三十五类）； \r\n——电话市场营销服务（第三十五类）。');
INSERT INTO `coi_category_one` VALUES ('39', '39', '39', '39', '第三十九类 运输，商品包装和贮藏，旅行安排', '0', '1', '1', '0', '[注释]\r\n第三十九类主要包括将人或商品从一处运送到另一处（通过铁路、公路、水上、空中或管道）所提供的服务和与此有关的必要服务，以及货栈或者其他建筑物为便于看管、保存商品所提供贮藏的服务。 \r\n本类尤其包括： \r\n——供运输者使用的由车站、桥梁、火车渡轮等公司提供的服务； \r\n——租赁运输车辆的服务； \r\n——与海上拖曳、卸货、港口和码头运转、营救遇险船只及其货物有关的服务； \r\n——发货前的包装和打包业务的服务； \r\n——经纪人及旅行社提供旅行或货运情况的服务以及提供价目、时刻或运送方式情况的服务； \r\n——运输前检查车辆或货物的服务。 \r\n本类尤其不包括： \r\n——与运输企业广告有关的服务，如散发广告传单或无线电广告（第三十五类）； \r\n——由经纪人或旅行社提供的发行旅行支票或者信用证的服务（第三十六类）； \r\n——人或货物在运输过程中的（商业、火灾或生命）保险服务（第三十六类）； \r\n——维修车辆的服务，以及维修用于运输人或货物的运输工具的服务（第三十七类）； \r\n——由旅行社或经纪人提供的预定旅馆房间的服务（第四十三类）。');
INSERT INTO `coi_category_one` VALUES ('40', '40', '40', '40', '第四十类 材料处理', '0', '1', '1', '0', '[注释]\r\n第四十类主要包括没有列入其他类别的，对有机物质、无机物质或物品进行机械或者化\r\n学处理或者加工的服务，包括定制生产服务。\r\n  按分类的要求，只有在为他人提供的情况下，商品的制造或生产才被视为服务。\r\n  如果制造或生产不是为履行满足客户的特殊需要、要求或规格的产品订单，则一般从属于制造商交易活动中的主要商业行为或是商品。\r\n  如果物质或物品被其处理、加工或制造方交易给第三方，则一般不视为服务。 \r\n本类尤其包括： \r\n——对物品或物质进行加工的服务，包括改变其主要特性的处理服务（如染服装）；按正常分类，维修服务应该列入第三十七类，但若是进行了这样的改变，即可列入第四十类（如汽车防冲击装置的镀铬处理）； \r\n——在物质生产或建筑物建造过程中的材料处理服务，如切割、加工成形，磨光或金属镀层方面的服务。\r\n——根据他人的订单和规格要求定制生产产品（须明确的是：某些主管局要求必须指明制造的产品），例如汽车定制生产 \r\n本类尤其不包括： \r\n——修理服务（第三十七类）。\r\n——某些定制服务，例如汽车定制喷漆（第三十七类）。');
INSERT INTO `coi_category_one` VALUES ('41', '41', '41', '41', '第四十一类 教育；提供培训；娱乐；文体活动', '0', '1', '1', '0', '[注释]\r\n第四十一类主要包括由个人或团体提供的人或动物智力开发方面的服务，以及用于娱乐或消遣时的服务。 \r\n本类尤其包括： \r\n——有关人员教育或动物训练的各种形式的服务； \r\n——旨在人们娱乐、消遣或文娱活动的服务； \r\n——为文化和教育目的向公众展示可视艺术作品或文学作品。');
INSERT INTO `coi_category_one` VALUES ('42', '42', '42', '42', '第四十二类 科学技术服务和与之相关的研究与设计服务；工业分析与研究；计算机硬件与软件的设计与开发；', '0', '1', '1', '0', '[注释]\r\n第四十二类主要包括由人，个人或集体，提供的涉及复杂领域活动的理论和实践服务；这些服务由诸如化学家、物理学家、工程师、计算机程序员等专业人员提供。 \r\n本类尤其包括： \r\n——由从事评估、估算以及从事科技领域研究与报告的工程师和科学家提供的服务（包括技术咨询）； \r\n——为医务目的所做的科学研究服务。 \r\n本类尤其不包括： \r\n——商业研究与开发（第三十五类）； \r\n——文字处理和计算机档案管理（第三十五类）； \r\n——金融与财政评估（第三十六类）； \r\n——采矿和石油开采（第三十七类）； \r\n——计算机（硬件）的安装与维修服务（第三十七类）； \r\n——由专业人员诸如医生、兽医和精神分析医生所提供的服务（第四十四类）； \r\n——医疗服务（第四十四类）； \r\n——花园设计（第四十四类）； \r\n——法律服务（第四十五类）。');
INSERT INTO `coi_category_one` VALUES ('43', '43', '43', '43', '第四十三类 提供食物和饮料服务；临时住宿', '0', '1', '1', '0', '[注释]\r\n第四十三类主要包括由个人或机构为消费者提供食物和饮料的服务以及为使在宾馆、寄宿处或其他提供临时住宿的机构得到床位和寄宿所提供的服务。 \r\n本类尤其包括： \r\n——为旅游者提供住宿预订服务，尤其是通过旅行社或经纪人提供的服务； \r\n——为动物提供膳食。 \r\n本类尤其不包括： \r\n——提供永久使用的不动产，例如住房、公寓等的租赁服务（第三十六类）； \r\n——由旅行社提供的旅行服务（第三十九类）； \r\n——食物和饮料的防腐处理服务（第四十类）； \r\n——迪斯科舞厅服务（第四十一类）； \r\n——寄宿学校（第四十一类）； \r\n——疗养院（第四十四类）。');
INSERT INTO `coi_category_one` VALUES ('44', '44', '44', '44', '第四十四类 医疗服务；兽医服务；人或动物的卫生和美容服务；农业、园艺或林业服务', '0', '1', '1', '0', '[注释]\r\n第四十四类主要包括由个人或机构向人或动物提供的医疗、卫生和美容服务；它还包括与农业、园艺和林业领域相关的服务。 \r\n本类尤其包括： \r\n——与治疗病人（例如Ｘ光检查和取血样）有关的医学分析； \r\n——人工授精服务； \r\n——医药咨询； \r\n——动物饲养； \r\n——与植物生长例如园艺有关的服务； \r\n——与植物艺术例如园艺设计和花卉构图有关的服务。 \r\n本类尤其不包括： \r\n——灭害虫（为农业、园艺和林业目的除外）（第三十七类）； \r\n——灌溉系统的安装与维修服务（第三十七类）； \r\n——救护运输（第三十九类）； \r\n——动物屠宰及其标本制作（第四十类）； \r\n——树木砍伐和加工（第四十类）； \r\n——动物驯养（第四十一类）； \r\n——为体育锻炼目的而设的健康俱乐部（第四十一类）； \r\n——医学科学研究服务（第四十二类）； \r\n——为动物提供膳食（第四十三类）； \r\n——养老院（第四十三类）。');
INSERT INTO `coi_category_one` VALUES ('45', '45', '45', '45', '第四十五类　法律服务，由他人提供的为满足个人需要的私人和社会服务；为保护财产和人身安全的服务', '0', '1', '1', '0', '[注释]\r\n本类尤其包括： \r\n——由律师、法律助理和私人律师为个人、组织、团体、企业提供的服务； \r\n——与个人或团体的安全相关的调查和监视服务； \r\n——为个人提供的与社会活动相关的服务，例如社交护送服务、婚姻介绍所、葬礼服务。 \r\n本类尤其不包括： \r\n——为商业运作提供直接指导的专业服务（第三十五类）； \r\n——为处理与保险有关的金融或货币事务和服务有关的服务（第三十六类）； \r\n——护送旅客（第三十九类）； \r\n——安全运输（第三十九类）； \r\n——各种个人教育服务（第四十一类）； \r\n——歌唱演员和舞蹈演员的表演（第四十一类）； \r\n——为保护计算机软件所提供的计算机服务（第四十二类）； \r\n——由他人为人类和动物提供的医疗、卫生或美容服务（第四十四类）； \r\n——某些出租服务（查阅按字母顺序排列的服务分类表和一般性说明中有关服务分类的第2条）。');
