INSERT INTO `enterprise` VALUES ('1', '<h5>&nbsp;&nbsp;果汇佳果品超市连锁公司本着质量第一的宗旨，在原产地采购是已对每个批次的商品进行内在和外在的挑选。并新引进日本原装进口的检测仪，对每一批次的商品进行糖分等检测，努力达到商品以最佳口味上柜销售，以实现公司郑重承诺。公司传承一贯做法，现所有经营的商品全部从原产地采购。严格把控货源质量。最快的速度，最少的环节，让消费者吃得新鲜，吃得放心专业人员品质把控\r\n \r\n每盒送达客户的水果，都是由果汇佳专业人员逐个挑选。我们认真为客户把好每道关，用心做好每次质检，这一切只为把最优质最新鲜的水果送到千家万户，让客户享受来自不同地域的美味水果同时，也享受到果汇佳的热情服务。<br/>&nbsp;<img style=\"width: 206px; height: 169px; display: inline;\" alt=\"\" src=\"http://www.guohuijiashop.com/page/pics/20121019/201210191350638294062.jpg\" width=\"50\" height=\"20\" border=\"0\"/><img style=\"width: 225px; height: 166px; display: inline;\" alt=\"\" src=\"http://www.guohuijiashop.com/page/pics/20121110/201211101352527177218.jpg\" width=\"668\" height=\"518\" border=\"0\"/><img style=\"width: 216px; height: 161px; display: inline;\" alt=\"\" src=\"http://www.guohuijiashop.com/page/pics/20121110/201211101352528205718.jpg\" width=\"824\" height=\"525\" border=\"0\"/></h5><p><br/></p>', null, '0', '0', '0', '110', '110', '1481356629049', '0', '1481357284604', '0', '张伟', '18131372222', '张家口市桥东区钻石南路11号', '河北省张家口市桥东区水果生产基地', 'OHYMM4', '1', '0', '0', '0', '0');
INSERT INTO `enterprise` VALUES ('2', '<p>阿斯顿噶似的啊</p><p>　　万达集团创立于1988年，形成商业、文化、金融三大产业集团，2015年资产6340亿元，收入2901亿元。万达商业是世界最大的不动产企业，世界最大的五星级酒店业主;万达文化集团是中国最大的文化企业、世界最大的电影院线运营商，世界最大的体育公司;万达金融是中国最大的网络金融企业。万达集团的目标是到2020年，资产达到2000亿美元，市值2000亿美元，收入1000亿美元，净利润100亿美元，成为世界一流跨国企业。</p><p style=\"text-align:center\"><img src=\"/ueditor/jsp/upload/image/20161210/1481359757189068110.jpg\" title=\"1470203186436157.jpg\" alt=\"1470203186436157.jpg\" style=\"width: 500px; height: 333px;\" width=\"500\" vspace=\"0\" height=\"333\" border=\"0\"/></p><p>　　万达商业(03699.HK)是全球规模最大的不动产企业，截至2016年7月，已在全国开业145座万达广场、93家酒店，持有物业面积2831万平方米。万达商业拥有全国唯一的商业规划研究院、酒店设计研究院、全国性的商业地产建设和管理团队，形成商业地产的完整产业链和企业的核心竞争优势。2015年，万达商业开始向轻资产模式转型，标志着万达商业的发展进入靠品牌获取利润的崭新阶段。</p><p>　　万达文化产业集团是中国最大的文化企业，资产903亿元，2015年收入512亿元，旗下包括影视、体育、<a href=\"http://lvyou.liuxue86.com/\" target=\"_blank\">旅游</a>、儿童娱乐4家公司，目标是2020年成为收入排名全球前五的文化企业。</p><p>　　万达金融集团旗下拥有网络金融、投资、保险等公司，为商家和消费者提供一站式创新金融服务，2015年收入209亿元。</p><p><br/></p>', null, '0', '0', '0', '111', '111', '1481359661169', '0', '1481359776961', '0', '李四', '6543875', '河北北方学院', '河北北方学院第一代理', 'OHYOJU', '2', '0', '0', '0', '0');
