INSERT INTO `enterprise` VALUES ('5', '<p><a href=\"http://bbs.tiexue.net/post_11473365_1.html?s=data\" target=\"_blank\" title=\"泰国超过中国主导越南水果市场\">\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://small8.itiexue.net/2211/22113128.jpg\" alt=\"泰国超过中国主导越南水果市场\" width=\"135\" height=\"101\"/></a>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><h3><a href=\"http://bbs.tiexue.net/post_11473365_1.html?s=data\" target=\"_blank\" title=\"泰国超过中国主导越南水果市场\">泰国超过中国主导越南水果市场</a></h3><p class=\"date\">05月20日 09:26</p><p>（图片：越南媒体）\r\n\r\n中国日报河内5月19日电（记者 王健）据越南每日快讯19日报道，2016年第一季度，泰国水果尽管价格高，还是大量涌入越南市场，并占越南水果进口总值的38.18%。\r\n\r\n越南果蔬联合会数据显示，越南水果进口总额在今年第一季度达到1.568亿美元...</p><p><a href=\"http://bbs.tiexue.net/post_4394987_1.html?s=data\" target=\"_blank\" title=\"水果市场随拍\">\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://img11.itiexue.net/1156/11560871.jpg\" alt=\"水果市场随拍\" width=\"135\" height=\"101\"/></a>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><h3><a href=\"http://bbs.tiexue.net/post_4394987_1.html?s=data\" target=\"_blank\" title=\"水果市场随拍\">水果市场随拍</a></h3><p class=\"date\">08月02日 20:28</p><p>天气晴\r\n &nbsp; &nbsp; &nbsp;手机三星G508E\r\n &nbsp; &nbsp; &nbsp;时间2010.7.20\r\n &nbsp; &nbsp; &nbsp;地点水果市场\r\n &nbsp; &nbsp; &nbsp;\r\n\r\n\r\n\r\n\r\n\r\n[img]http://pic2.itiexue.net/pics/2010_8_2_</p><h3><a href=\"http://bbs.tiexue.net/post_3138336_1.html?s=data\" target=\"_blank\" title=\"乌鲁木齐奇台路水果市场每天烂橘20吨(图)\">乌鲁木齐奇台路水果市场每天烂橘20吨(图)</a></h3><p class=\"date\">10月28日 13:57</p><p>核心提示：乌鲁木齐主要批发柑橘的奇台路水果批发市场柑橘严重滞销，批发商们不得不忍痛将腐烂的柑橘挑出来扔掉，整个市场里弥漫着腐烂柑橘散发出来的臭味。 \r\n\r\n　　\r\n\r\n　　在奇台路水果批发市场，大量腐烂的橘子被扔在货车四周。（记者陈岩摄） \r\n\r\n　　[img]http...</p><p><a href=\"http://bbs.tiexue.net/post_4243368_1.html?s=data\" target=\"_blank\" title=\"刚刚上市的水果\">\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://img6.itiexue.net/1112/11120862.jpg\" alt=\"刚刚上市的水果\" width=\"135\" height=\"101\"/></a>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><h3><a href=\"http://bbs.tiexue.net/post_4243368_1.html?s=data\" target=\"_blank\" title=\"刚刚上市的水果\">刚刚上市的水果</a></h3><p class=\"date\">05月10日 20:58</p><p>刚刚上市的水蜜桃和西瓜\r\n &nbsp; &nbsp; \r\n &nbsp; &nbsp;三星G508E &nbsp;2010 5.09\r\n &nbsp; &nbsp; &nbsp; &nbsp; 水果市场</p><p><a href=\"http://bbs.tiexue.net/post_5867746_1.html?s=data\" target=\"_blank\" title=\"不要肯定的说菲律宾水果没人买\">\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://small9.itiexue.net/1493/14933625.jpg\" alt=\"不要肯定的说菲律宾水果没人买\" width=\"135\" height=\"101\"/></a>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><h3><a href=\"http://bbs.tiexue.net/post_5867746_1.html?s=data\" target=\"_blank\" title=\"不要肯定的说菲律宾水果没人买\">不要肯定的说菲律宾水果没人买</a></h3><p class=\"date\">05月29日 11:30</p><p>本来LZ是想在TB的水果市场买点水果，无意间发现菲佣的水果销量竟然还这么高。最近都在说菲佣的水果没人买，看来也不完全，还是有少数人愿意顶着汉奸的名头买菲佣的高价水果。我就想不明白了，这些人不吃会死啊. . .\r\n\r\n\r\n香蕉月销量51,价格比国产的差不多贵了一倍\r\n\r\n...</p><p><br/></p>', null, '0', '0', '0', '446', '446', '1481605203396', '0', '1481605614439', '0', '王二', '1394586424', '河北省邯郸市成安县', '河北省邯郸市成安县第一水果市场', 'OI3YQJ', '2', '0', '0', '0', '0');
INSERT INTO `enterprise` VALUES ('6', '<p>消费需求日益提高水果超市应运而生</p><p>　　随着人民生活水平显着提高，水果正逐渐成为人们生活的必需品。水果不同于其他食品，对&quot;新鲜&quot;的要求非常高，而小商贩和传统水果店都无法满足广大消费者对水果的鲜、奇、特以及优质水果购买环境的需求。</p><p>　　记者日前探访了谈中路、严丰路上的丰硕果业量贩式大卖场以及鑫迪果园等水果超市。综合起来看，这些水果超市比较一致的特点是：专业化经营、超市化服务，这是街头水果摊所无法比拟的。</p><p>　　所谓专业化经营，简而言之，就是专营水果，与水果散户从批发市场进货赚批零差价不同的是，水果超市采用的主要是&quot;从基地到门店&quot;的直销服务模式(也有部分是从水果批发市场进货)。</p><center><img alt=\"水果超市\" src=\"/ueditor/jsp/upload/image/20161213/1481606025081040542.jpg\" width=\"400\" height=\"300\" border=\"1\" align=\"right\"/></center><p>　　走进水果超市，给人最直接的感受是：富有创意的店堂布置、比较亲近的超市化服务。水果超市营造出的是一种&quot;城市中的水果园&quot;的氛围：仿真的椰子树上挂着熟透的芒、菠萝，琳琅满目的水果用藤制大篓或是长板条木筐盛放，超市里还洋溢着一股浓郁的果香。超市里的水果明码标价，消费者可以拎着超市篮自选，打扮得有点乡土味的&quot;水果小姐&quot;还会适时提供服务。</p><p>　　来自上海农产品中心批发市场的数据显示：近几年来，该市场的水果销量增长幅度持续上升，稳步增长的态势显示了市民水果消费节节高。上海人的水果消费更趋于精细化、更注重品质。</p><p>　　看着同行们办起了水果超市势头不错，一位与记者熟悉的果品批发行赵经理乐呵呵地说：&quot;目前我们的水果批发生意一年比一年好，等来年我也想办一个精品水果超市，把生意做到百姓家里去。&quot;据悉，上海水果超市在短期内初露锋芒，已有10多家店号&quot;新鲜&quot;入市，其中更有雄心勃勃的投资者放言：今年目标要开20家!</p><p><strong>　　■经营范围</strong></p><p>　　经销中外精品水果</p><p>　　根据资金取舍品种</p><p>　　经销各地国产、进口的精品水果。数量以及品种，可以根据你的资金实力来定夺。</p><p><strong>　　■开业条件</strong></p><p><br/></p>', null, '0', '0', '0', '447', '447', '1481605899102', '0', '1481606027556', '0', '赵四', '15964823578', '河北省邯郸市', '河北省邯郸市第二水果市场', 'OI3YQO', '2', '0', '0', '0', '0');
