INSERT INTO `enterprise` VALUES ('12', '<p>中兴通讯是全球领先的综合通信解决方案提供商。公司通过为全球160多个国家和地区的电信运营商和企业网客户提供创新技术与产品解决方案，让全世界用户享有语音、数据、多媒体、无线宽带等全方位沟通。公司成立于1985年，在香港和深圳两地上市，是中国最大的通信设备上市公司。</p><p>&nbsp;</p><p>　　中兴通讯拥有通信业界最完整的、端到端的产品线和融合解决方案，通过全系列的无线、有线、业务、终端产品和专业通信服务，灵活满足全球不同运营商和企业网客户的差异化需求以及快速创新的追求。2014年中兴通讯实现营业收入814.7亿元人民币，净利润26.3亿元人民币，同比增长94%。目前，中兴通讯已全面服务于全球主流运营商及企业网客户，智能终端发货量位居美国前四，并被誉为“智慧城市的标杆企业”。</p><p>&nbsp;</p><p>　　中兴通讯坚持以持续技术创新为客户不断创造价值。公司在美国、法国、瑞典、印度、中国等地共设有20个全球研发机构，近3万名国内外研发人员专注于行业技术创新；PCT专利申请量近5年均居全球前三，2011、2012年PCT蝉联全球前一。公司依托分布于全球的107个分支机构，凭借不断增强的创新能力、突出的灵活定制能力、日趋完善的交付能力赢得全球客户的信任与合作。</p><p>&nbsp;</p><p>　　中兴通讯为联合国全球契约组织成员，坚持在全球范围内贯彻可持续发展理念，实现社会、环境及利益相关者的和谐共生。我们运用通信技术帮助不同地区的人们享有平等的通信自由；我们将“创新、融合、绿色”理念贯穿到整个产品生命周期，以及研发、生产、物流、客户服务等全流程，为实现全球性降低能耗和二氧化碳排放不懈努力。我们还在全球范围内开展社区公益和救助行动，参加了印尼海啸、海地及汶川地震等重大自然灾害救助，并成立了中国规模最大的“关爱儿童专项基金”。</p><p>&nbsp;</p><p>　　未来，中兴通讯将继续致力于引领全球通信产业的发展，应对全球通信领域更趋日新月异的挑战。　</p><p style=\"text-align:center\"><a href=\"http://www.zte.com.cn/cnvideo/press_center/video/201402/t20140213_417910.html\" _fcksavedurl=\"http://www.zte.com.cn/cnvideo/press_center/video/201402/t20140213_417910.html\"><span style=\";text-underline:none\"><img src=\"images/upload/20161222/1482389471657010634.jpg\" alt=\"http://www.zte.com.cn/cn/about/corporate_information/201410/W020141028391057404249.jpg\" title=\"1482389471657010634.jpg\" border=\"0\"/></span></a>　　</p><p style=\"text-align:center\">　　<a href=\"http://www.zte.com.cn/cnvideo/press_center/video/201402/t20140213_417910.html\" _fcksavedurl=\"http://www.zte.com.cn/cnvideo/press_center/video/201402/t20140213_417910.html\">（点击观看公司形象片）</a></p><p>&nbsp;</p><p><br/></p>', null, '0', '0', '0', '11', '11', '1482389273398', '0', '1482389500767', '0', '单鹏飞', '181', '张家口厂家路', '大众厂家', 'OIKS8G', '1', '0', '0', '0', '0');
INSERT INTO `enterprise` VALUES ('13', '<p style=\"margin-top:7px;margin-right:0;margin-bottom:7px;margin-left:0;margin-top:auto;margin-bottom:auto;text-indent:32px;text-autospace:ideograph-numeric;text-align:left\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">宜春日盛科技有限公司是专业从事研发</span>/<span style=\"font-family:宋体\">生产</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">销售</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">燃放于一体的企业。日盛彩烟下设彩烟研发中心、日景彩烟生产基地、烟花生产基地、冷焰火生产基地、运营销售中心、燃放表演设计中心。</span></span></p><p><img src=\"images/upload/20170110/1484038723916045780.png\" title=\"1484038723916045780.png\"/></p><p style=\"margin-top:7px;margin-right:0;margin-bottom:7px;margin-left:0;margin-top:auto;margin-bottom:auto;text-indent:32px;text-autospace:ideograph-numeric;text-align:left\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">日盛科技专业生产白天庆典类喜庆产品，使您的庆典更绚丽多彩。</span> “<span style=\"font-family:宋体\">日景彩烟</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">的出现是烟花产品发展技术上的一个里程碑式的突破。</span></span></p><p style=\"margin-top:7px;margin-right:0;margin-bottom:7px;margin-left:0;margin-top:auto;margin-bottom:auto;text-indent:32px;text-autospace:ideograph-numeric;text-align:left\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">它具有无火药爆源</span>,<span style=\"font-family:宋体\">无毒害气体</span><span style=\"font-family:Calibri\">,</span><span style=\"font-family:宋体\">运输和储存安全可靠、燃放简单安全的特点，适用于各种白天庆典场合。庆典彩烟燃放效果具有红、黄、蓝、绿、橙、黑、白七种颜色，燃放高度可达到</span><span style=\"font-family:Calibri\">25-30</span><span style=\"font-family:宋体\">米。</span></span></p><p><span style=\";font-family:Calibri;font-size:14px\">&nbsp;</span></p><p><br/></p>', null, '0', '0', '0', 'yc', 'yc', '1484038489888', '0', '1484038727866', '0', '任盈盈', '15136451235', '江西宜春新华路23号', '宜春日盛科技有限公司', 'OJK47O', '1', '0', '0', '0', '0');
INSERT INTO `enterprise` VALUES ('14', '<p style=\"margin-right:0;margin-left:0;text-indent:32px;text-autospace:ideograph-numeric;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">公司在德国设立了办事处，与欧洲、美国、日本等百余家国外出版社保持良好的合作关系。目前我们是美国企鹅公司下属的</span> Viking, DUTTON 、PLUME、SIGNET、ROC/ONYX 中文版权的独家代理人，并</span><a href=\"http://www.xuexila.com/success/\"><span style=\"text-decoration:underline;\"><span style=\";font-family:宋体;color:rgb(0,0,255);text-underline:single;font-size:16px\"><span style=\"font-family:宋体\">成功</span></span></span></a><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">地进行了海明威全部作品的全球中文版权代理等数百项中介活动。国内有近五十家出版社成为我们的特惠客户。</span></span></p><p><img src=\"images/upload/20170110/1484039010333072667.png\" title=\"1484039010333072667.png\"/></p><p style=\"margin-right:0;margin-left:0;text-indent:32px;text-autospace:ideograph-numeric;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-size:16px\">1996年底，受中国著作权使用报酬收转中心的委托，开始承担上海市报刊转载、摘编作品报酬的收转工作。并于2000年底正式挂牌成立了“中国著作权使用报酬收转中心上海办事处”。</span></p><p><br/></p>', null, '0', '0', '0', 'hb', 'hb', '1484038502378', '0', '1484039013139', '0', '郭靖', '13111854424', '河北省石家庄市太和电子城对过', '河北代理总部', 'OJK481', '2', '0', '0', '0', '0');
INSERT INTO `enterprise` VALUES ('15', '<p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:32px;text-autospace:ideograph-numeric\"><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">张家口代理总部</span></span><span style=\";font-family:Calibri;font-size:16px\">[1] <span style=\"font-family:宋体\">是经</span></span><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">张家口</span></span><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">市工商</span></span><a href=\"http://www.xuexila.com/lunwen/management/xingzhengguanli/\"><span style=\"text-decoration:underline;\"><span style=\";font-family:&#39;Times New Roman&#39;;color:rgb(0,0,255);text-underline:single\"><span style=\"font-family:宋体\">行政管理</span></span></span></a><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">局登记注册的一家具备专业企业注册登记代理资格的企业。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:32px;text-autospace:ideograph-numeric\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">本公司拥有一支高素质且经验丰富的工商、税务、财务顾问队伍</span>,<span style=\"font-family:宋体\">秉承</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">以质量求信誉，以信誉求发展</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">的经营宗旨，形成了一套管理规范、服务优良、工作高效、政策把握严谨、</span></span><a href=\"http://www.xuexila.com/chuangye/caiwu/\"><span style=\"text-decoration:underline;\"><span style=\";font-family:&#39;Times New Roman&#39;;color:rgb(0,0,255);text-underline:single\"><span style=\"font-family:宋体\">财务管理</span></span></span></a><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">制度严格的服务体系。随着市场经济的不断发展和</span>2006<span style=\"font-family:宋体\">年</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">日新《</span></span><a href=\"http://www.xuexila.com/chuangye/falv/\"><span style=\"text-decoration:underline;\"><span style=\";font-family:&#39;Times New Roman&#39;;color:rgb(0,0,255);text-underline:single\"><span style=\"font-family:宋体\">公司法</span></span></span></a><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">》的顺利实施，为很多想</span></span><a href=\"http://www.xuexila.com/chuangye/\"><span style=\"text-decoration:underline;\"><span style=\";font-family:&#39;Times New Roman&#39;;color:rgb(0,0,255);text-underline:single\"><span style=\"font-family:宋体\">创业</span></span></span></a><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">的人提供了良好的契机，各类老企业和新办企业的需求也急剧扩大，本公司争对各类企业的不同需求提供全方位的服务，在服务的过程中不断提升自身价值，且与工商保持着广泛的沟通，能及时准确地为企业经营决策提供政策、法规方面的最新信息及服务。</span></span></p><p><span style=\";font-family:宋体;font-size:16px\">&nbsp;</span></p><p><img src=\"images/upload/20170110/1484039181666078588.png\" title=\"1484039181666078588.png\"/></p><p style=\"margin-right:0;margin-left:0;text-indent:32px;text-autospace:ideograph-numeric\"><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">本公司地处萧山区范围，拥有便捷的交通，良好的工作环境，执业行为规范并具有业务不受行政区域限制的行业优势，我们的目标是以最小的成本帮助企业实现利润最大化。</span></span></p><p><span style=\";font-family:宋体;font-size:16px\">&nbsp;</span></p><p><br/></p>', null, '0', '0', '0', 'zjk', 'zjk', '1484038526760', '0', '1484039184619', '0', '张无忌', '15135426452', '河北张家口展览馆', '张家口代理总部', 'OJK47V', '2', '0', '0', '0', '0');
INSERT INTO `enterprise` VALUES ('16', '<p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:32px;text-autospace:ideograph-numeric\"><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">万博批发</span></span><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">，是中国海洋石油总公司所属从事销售和贸易业务的专业化公司，</span>2008<span style=\"font-family:宋体\">年</span><span style=\"font-family:Calibri\">4</span><span style=\"font-family:宋体\">月在北京成立。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;text-indent:32px;text-autospace:ideograph-numeric\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">销售公司主体由中国化工供销</span>(<span style=\"font-family:宋体\">集团</span><span style=\"font-family:Calibri\">)</span><span style=\"font-family:宋体\">总公司、中海石油炼化有限责任公司销售分公司、中海石油化工进出口有限公司和中国化工建设总公司精细化工贸易业务组成，相关资产、业务、人员由销售公司统一管理。</span></span></p><p><span style=\";font-family:宋体;font-size:16px\">&nbsp;</span></p><p><img src=\"images/upload/20170110/1484039391361009733.png\" title=\"1484039391361009733.png\"/></p><p style=\"margin-right:0;margin-left:0;text-indent:32px;text-autospace:ideograph-numeric\"><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">销售公司的使命是提升全球资源配置能力，提升对终端市场的影响力，促进上下游产业良性互动，做强做大贸易产业，为建设国际一流能源公司贡献价值。主要负责原油、成品油及化工产品的销售贸易、仓储物流和营销网络建设</span>;致力于为客户提供解决方案;按照总公司的整体安排，承担总公司下游有关产品的销售工作。</span></p><p><br/></p>', null, '0', '0', '0', 'wb', 'wb', '1484038541629', '0', '1484039394386', '0', '小龙女', '13124567854', '河北张家口万博市场', '万博批发', 'OJK48J', '4', '0', '0', '0', '0');
