INSERT INTO `product` VALUES ('1', '0', '1', '<p>\r\n					</p><p>\r\n					</p><h2>淡奶油提子蛋糕的做法步骤</h2><p>\r\n																	</p><p>\r\n\r\n													</p><p><a class=\"cboxElement\" rel=\"recipe_img\" href=\"http://cp2.douguo.net/upload/caiku/d/9/2/yuan_d90479193f168c98b77431deece0d462.jpeg\"><img src=\"/ueditor/jsp/upload/image/20161210/1481358989631000868.jpg\" alt=\"淡奶油提子蛋糕的做法图解1\"/></a></p><p>\r\n							</p><p><span class=\"fwb\">1.</span> 蛋黄加淡奶油和糖，搅拌均匀后，加入过筛的低粉，再搅拌均匀。</p><p>\r\n												</p><p>\r\n																		</p><p>\r\n\r\n													</p><p><a class=\"cboxElement\" rel=\"recipe_img\" href=\"http://cp2.douguo.net/upload/caiku/f/c/b/yuan_fc21a68e86950ebac253fa872d3feabb.jpeg\"><img src=\"/ueditor/jsp/upload/image/20161210/1481358989693047103.jpg\" alt=\"淡奶油提子蛋糕的做法图解2\"/></a></p><p>\r\n							</p><p><span class=\"fwb\">2.</span> 蛋清分次加糖打发。</p><p>\r\n												</p><p>\r\n																		</p><p>\r\n\r\n													</p><p><a class=\"cboxElement\" rel=\"recipe_img\" href=\"http://cp2.douguo.net/upload/caiku/9/2/f/yuan_927230cd0b9d1f2ba7c896c6980b96ff.jpeg\"><img src=\"/ueditor/jsp/upload/image/20161210/1481358989739065976.jpg\" alt=\"淡奶油提子蛋糕的做法图解3\"/></a></p><p>\r\n							</p><p><span class=\"fwb\">3.</span> 取三分之一蛋白到蛋黄中，切伴均匀</p><p>\r\n												</p><p>\r\n																		</p><p>\r\n\r\n													</p><p><a class=\"cboxElement\" rel=\"recipe_img\" href=\"http://cp2.douguo.net/upload/caiku/f/7/5/yuan_f793f4c2d9b3abe60947e3fbf5a24355.jpeg\"><img src=\"/ueditor/jsp/upload/image/20161210/1481358989785037808.jpg\" alt=\"淡奶油提子蛋糕的做法图解4\"/></a></p><p>\r\n							</p><p><span class=\"fwb\">4.</span> 再倒回剩余的蛋白中，切伴均匀，烤箱预热。</p><p>\r\n												</p><p>\r\n																		</p><p>\r\n\r\n													</p><p><a class=\"cboxElement\" rel=\"recipe_img\" href=\"http://cp2.douguo.net/upload/caiku/e/7/c/yuan_e7006e524f19a5f7dd5eb843a34054ac.jpeg\"><img src=\"/ueditor/jsp/upload/image/20161210/1481358989830043011.jpg\" alt=\"淡奶油提子蛋糕的做法图解5\"/></a></p><p>\r\n							</p><p><span class=\"fwb\">5.</span> 倒入模具中，（模具中铺油纸）撒上提子。</p><p>\r\n												</p><p>\r\n																		</p><p>\r\n\r\n													</p><p><a class=\"cboxElement\" rel=\"recipe_img\" href=\"http://cp2.douguo.net/upload/caiku/8/8/7/yuan_88908ac0cebedcc64da86686514d4fd7.jpeg\"><img src=\"/ueditor/jsp/upload/image/20161210/1481358989880070183.jpg\" alt=\"淡奶油提子蛋糕的做法图解6\"/></a></p><p>\r\n							</p><p><span class=\"fwb\">6.</span> 入烤箱，中层160度，45分钟。</p><p>\r\n												</p><p>\r\n																		</p><p>\r\n\r\n													</p><p><a class=\"cboxElement\" rel=\"recipe_img\" href=\"http://cp2.douguo.net/upload/caiku/0/d/5/yuan_0d26caf0d30fd45eba332125425ab6d5.jpeg\"><img src=\"/ueditor/jsp/upload/image/20161210/1481358989969013339.jpg\" alt=\"淡奶油提子蛋糕的做法图解7\"/></a></p><p>\r\n							</p><p><span class=\"fwb\">7.</span> 微凉切块，撒上椰蓉口味更赞！</p><p>\r\n												</p><p>\r\n															</p><p>\r\n			&nbsp; &nbsp;</p><h3 class=\"t\"><a data-click=\"{\r\n			&#39;F&#39;:&#39;F78717EA&#39;,\r\n			&#39;F1&#39;:&#39;9D73F1E4&#39;,\r\n			&#39;F2&#39;:&#39;4CA6DE6B&#39;,\r\n			&#39;F3&#39;:&#39;54E5343F&#39;,\r\n			&#39;T&#39;:&#39;1481358843&#39;,\r\n						&#39;y&#39;:&#39;53777AF1&#39;\r\n			 \r\n									}\" href=\"http://www.baidu.com/link?url=dcY10VH9AZO66RUiMo-kHZUB6hI3l48CPyx63hn2rmIZCnEDygRQaoaimwkZGOnp\" target=\"_blank\"></a></h3><h3 class=\"t\"><a data-click=\"{\r\n			&#39;F&#39;:&#39;F78717EA&#39;,\r\n			&#39;F1&#39;:&#39;9D73F1E4&#39;,\r\n			&#39;F2&#39;:&#39;4CA6DE6B&#39;,\r\n			&#39;F3&#39;:&#39;54E5343F&#39;,\r\n			&#39;T&#39;:&#39;1481358843&#39;,\r\n						&#39;y&#39;:&#39;53777AF1&#39;\r\n			 \r\n									}\" href=\"http://www.baidu.com/link?url=dcY10VH9AZO66RUiMo-kHZUB6hI3l48CPyx63hn2rmIZCnEDygRQaoaimwkZGOnp\" target=\"_blank\"></a></h3><h3 class=\"t\"><a data-click=\"{\r\n			&#39;F&#39;:&#39;F78717EA&#39;,\r\n			&#39;F1&#39;:&#39;9D73F1E4&#39;,\r\n			&#39;F2&#39;:&#39;4CA6DE6B&#39;,\r\n			&#39;F3&#39;:&#39;54E5343F&#39;,\r\n			&#39;T&#39;:&#39;1481358843&#39;,\r\n